class UserTesting:
    def __init__(self):
        self.test_requests = []

    def schedule_user_testing(self, date, description):
        self.test_requests.append((date, description))
        return f"Scheduled user testing for {date}: {description}"

class APIService:
    def fetch_fpds_data(self):
        return "Fetched FPDS data."

    def fetch_fabs_data(self):
        return "Fetched FABS data."

class System:
    def __init__(self):
        self.submissions = []
        self.api_service = APIService()
        self.user_testing = UserTesting()

    def submit_data(self, user, submission):
        if isinstance(user, AgencyUser):
            user.submit(submission)
            self.submissions.append(submission)

    def fetch_data(self, user, data_type):
        if data_type == "FPDS":
            return self.api_service.fetch_fpds_data()
        elif data_type == "FABS":
            return self.api_service.fetch_fabs_data()
        return None

    def schedule_testing(self, date, description):
        return self.user_testing.schedule_user_testing(date, description)

# Example Usage
system = System()
agency_user = AgencyUser(1, "Agency User 1")
submission = Submission(101, "pending", {"data": "example_submission_data"})

system.submit_data(agency_user, submission)
print(agency_user.get_submission_history())
print(system.fetch_data(agency_user, "FABS"))
print(system.schedule_testing("2023-10-01", "Testing new UI changes."))
